import github from "../../Utils/images/github_64px.png";
import linkedin from "../../Utils/images/linkedin_64px.png";
import Gmail from "../../Utils/images/gmail_64px.png";

import "bootstrap/dist/css/bootstrap.min.css";
import "./Navi.css";
import { Col, Container, Row } from "react-bootstrap";
function Main() {
  return (
    
      <div id="menuCard" className="card">
        <div className="card-body">
          <p id="name" className="align-middle text-center card-title fw-bold">
            Joshua Coleman
          </p>
          <p id="position" className="text-center card-subtitle fw-bold">
            FULLSTACK WEB DEVELOPER
          </p>

          <a
            style={{ paddingLeft: 95 }}
            href="https://github.com/9314610Jc"
            target="_blank"
            rel="noopener noreferrer"
          >
            {" "}
            <img
              src={github}
              alt="github"
              style={{ height: 64, width: 64, marginLeft: "25%" }}
            ></img>
          </a>

          <a
            href="https://www.linkedin.com/in/joshua-coleman-b2b5531ba/"
            target="_blank"
            rel="noopener noreferrer"
          >
            <img
              src={linkedin}
              alt="linkedin"
              style={{ height: 64, width: 64, marginLeft: "35%" }}
            ></img>
          </a>

          <a
            href="mailto:jlc42302@gmail.com"
            target="_blank"
            rel="noopener noreferrer"
          >
            <img
              src={Gmail}
              alt="gmail"
              style={{ height: 64, width: 64, marginRight: "25%" }}
            ></img>
          </a>
        </div>
      </div>

  );
}
export default Main;
